import "./App.css";
import React from "react";
import Header from "./Header.js";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Footer from "./Footer";
import Pit from "./Pit";
import Main from "./Stats.js";
function App() {
  return (
    <Router>
      <Routes>
        <Route
          path="/pitStats"
          element={
            <>
              <Header name="Pit Stats" />
              <Main />
              <Footer />
            </>
          }
        ></Route>
        <Route
          path="/pitscouting"
          element={
            <>
              <Header name="Match Scouting" />
              <Pit />
              <Footer />
            </>
          }
        ></Route>
      </Routes>
    </Router>
  );
}

export default App;
